import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const Homepage = () => {
  const [isVehicleRegistered, setIsVehicleRegistered] = useState(false); // This state will handle whether the vehicle is registered or not

  return (
    <div className="homeContainerV">
      <div className="navbar">
        <a href="/">Home</a>
        <div>
          <Link to="/login">
            <button className="logInButton">Login</button>
          </Link>
          <Link to="/signup">
            <button className="signUpButton">Sign Up</button>
          </Link>
        </div>
      </div>

      <div className="mainHeaderV">
        <h1 className="title">Welcome to the Vehicle Portal</h1>
        <p className="subtitle">Easily manage your vehicle and fuel quotas</p>

        {!isVehicleRegistered ? (
          <div>
            <p>Your vehicle is not registered.</p>
            <Link to="/register-vehicle">
              <button className="registerButton">Register Vehicle</button>
            </Link>
          </div>
        ) : (
          <p>Your vehicle is registered. Go to the dashboard to view details.</p>
        )}
      </div>
    </div>
  );
};

export default Homepage;
